import s from './Messages.module.css';

const Messages = (props) => {
    return (
        <div className={s.messages}>
            <div className={s.messages-items}>
                <div className={s.items}>
                    David Bowie
                </div>
                <div className={s.items}>
                    Group Queen
                </div>
                <div className={s.items}>
                    Kanye West
                </div>
            </div>
        </div>
    )
}

export default Messages;
